import React from "react";
import ReactDOM from "react-dom";

//in react it possible for render ()
//to return an array element . [ JSX likh do ]
ReactDOM.render(
    <React.Fragment>
    <h1>Infoskillx</h1> 
    <p>Plz Like and Subscribe My Channel</p>
    </React.Fragment>,
    document.getElementById("root"));

    //or aise v likh sakte hai
ReactDOM.render(
    <>
    <h1>Infoskillx</h1> 
    <p>Plz Like and Subscribe My Channel</p>
    </>,
    document.getElementById("root"));
